import React from 'react';
import * as AiIcons from "react-icons/ai";
import * as IoIcons from "react-icons/io";

export const FacultySidebarData = [
    {
        title: 'Faculty',
        path: '/',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Faculty Marks',
        path: '/facultyMarks',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Documents',
        path: '/facultydocuments',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Time Table',
        path: '/facultyTimeTable',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },

    {
        title: 'Change Password',
        path: '/changePassword',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Admin Job',
        path: '/facultyadminjob',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Students',
        path: '/facultyStudentAPI',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    },
    {
        title: 'Courses Enrolled',
        path: '/facultyCourseEnrolled',
        icon: <AiIcons.AiFillProfile />,
        cName : 'nav-text01'
    }
]
